import React from "react";
import "./Container.css";

function Container() {
  return (
    <div className="container">
      <header className="header">
        <div className="rectangle rectangle--main"></div>
        <div className="rectangle"></div>
        <div className="rectangle"></div>
      </header>
    </div>
  );
}

export default Container;
